import React from "react";
import { NavLink } from "react-router-dom";
const NavBar = () => {
  return (
    <div>
      <nav style={{ backgroundColor: "lightBlue" }}>
        <NavLink to="rosary">Test link</NavLink>
      </nav>
    </div>
  );
};

export default NavBar;
